/*Table structure for table `e_pass_master` */

DROP TABLE IF EXISTS `e_pass_master`;

CREATE TABLE `e_pass_master` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `e_pass_no` bigint(20) DEFAULT NULL,
  `account_no` int(11) DEFAULT NULL,
  `employee_id_assignee` int(11) DEFAULT NULL,
  `assignee` varchar(25) DEFAULT NULL,
  `is_active` tinyint(1) DEFAULT NULL COMMENT '0 = active, 1 = inactive',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `e_pass_master` */

/*Table structure for table `fleet_card_master` */

DROP TABLE IF EXISTS `fleet_card_master`;

CREATE TABLE `fleet_card_master` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `fleet_card_no` bigint(20) DEFAULT NULL,
  `account_no` int(11) DEFAULT NULL,
  `employee_id_assignee` int(11) DEFAULT NULL,
  `assignee` varchar(20) DEFAULT NULL,
  `is_active` tinyint(1) DEFAULT NULL COMMENT '0 = active, 1 = inactive',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `fleet_card_master` */

