/* Function  structure for function  `CheckTripStatus` */

/*!50003 DROP FUNCTION IF EXISTS `CheckTripStatus` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `CheckTripStatus`(expected_time_of_return DATETIME,time_in DATETIME) RETURNS varchar(20) CHARSET latin1
    DETERMINISTIC
BEGIN
	DECLARE trip_status VARCHAR(20);
		if(time_in is null) then
			if(NOW() > expected_time_of_return) THEN
				SET trip_status = 'Overdue';
			else 
				SET trip_status = 'Not Yet Returned';
			END IF;
		else
			if(NOW() > expected_time_of_return) then
				set trip_status = 'Overdue';
			else
				set trip_status = 'Returned';
			end if;
		end if;
	RETURN (trip_status);
    END */$$
DELIMITER ;

/* Function  structure for function  `GetDriverName` */

/*!50003 DROP FUNCTION IF EXISTS `GetDriverName` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `GetDriverName`(driver_id varchar(20)) RETURNS varchar(100) CHARSET latin1
    DETERMINISTIC
BEGIN
	declare driver_name varchar(100);
	DECLARE isDriver integer;
	
	set isDriver = ROUND((LENGTH(driver_id)-LENGTH(REPLACE(driver_id, "DRV", "")))/LENGTH("DRV"));
	
	if isDriver > 0 then
		set driver_name = (SELECT CONCAT(first_name,' ',LEFT(middle_name,1),'. ',last_name) driver_name 
				   from sys_vehicle_monitoring.company_drivers_master 
				   WHERE driver_no = driver_id);
	else
		set driver_name = (SELECT CONCAT(b.first_name,' ',left(b.middle_name,1),'. ',b.last_name) driver_name
				   FROM ipc_central.employee_masterfile_tab a 
				   LEFT JOIN 
				   ipc_central.`personal_information_tab` b 
				   ON a.id = b.employee_id
				   where a.employee_no = driver_id);
	end if;
	return (driver_name);
    END */$$
DELIMITER ;

/* Function  structure for function  `GetLogType` */

/*!50003 DROP FUNCTION IF EXISTS `GetLogType` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `GetLogType`(log_type_id INT) RETURNS varchar(3) CHARSET latin1
    DETERMINISTIC
BEGIN
	DECLARE log_type varchar(3);
		IF(log_type_id = 1) THEN
			set log_type = 'In';
		ELSEIF(log_type_id = 2) THEN
			SET log_type = 'Out';
		END IF;
	return log_type;
    END */$$
DELIMITER ;

/* Function  structure for function  `GetStatusOfTrip` */

/*!50003 DROP FUNCTION IF EXISTS `GetStatusOfTrip` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `GetStatusOfTrip`(log_count INTEGER, expected_time_of_return DATETIME,time_in DATETIME) RETURNS varchar(25) CHARSET latin1
BEGIN
	DECLARE trip_status VARCHAR(25);
	
	IF log_count = 0 THEN
		IF (NOW() > expected_time_of_return) THEN
			SET trip_status = 'No logs and overdue';
		ELSE
			SET trip_status = 'No logs yet';
		end if;
	ELSEIF log_count = 1 THEN
		iF (now() > expected_time_of_return) THEN 
			SET trip_status = 'Open Trip and Overdue';
		ELSE 
			SET trip_status = 'Open Trip';
		END IF;
	ELSEIF log_count >= 2 THEN
		IF (time_in > expected_time_of_return) THEN
			SET trip_status = 'Closed Trip and Overdue';
		ELSE
			SET trip_status = 'Closed Trip';
		END IF;
	END IF;
	
	RETURN trip_status;
    END */$$
DELIMITER ;

/* Function  structure for function  `GetTripStatus` */

/*!50003 DROP FUNCTION IF EXISTS `GetTripStatus` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `GetTripStatus`(log_count integer) RETURNS varchar(11) CHARSET latin1
    DETERMINISTIC
BEGIN
    
	DECLARE trip_status VARCHAR(11);
	
	IF log_count = 0 THEN
		SET trip_status = 'No logs yet';
	ELSEIF log_count = 1 THEN
		SET trip_status = 'Open Trip';
	ELSEIF log_count >= 2 THEN
		SET trip_status = 'Closed Trip';
	end if;
	RETURN (trip_status);
	
    END */$$
DELIMITER ;

