/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_carplan_time_logs` AS (select `a`.`id` AS `id`,`a`.`employee_id` AS `employee_id`,concat(`c`.`first_name`,' ',left(`c`.`middle_name`,1),'. ',`c`.`last_name`) AS `emp_name`,`a`.`vehicle_id` AS `vehicle_id`,`a`.`log_time` AS `log_time`,`b`.`type` AS `type` from ((`sys_vehicle_monitoring`.`time_log` `a` left join `sys_vehicle_monitoring`.`log_type` `b` on((`a`.`log_type_id` = `b`.`id`))) left join `ipc_central`.`personal_information_tab` `c` on((`a`.`employee_id` = `c`.`employee_id`))) where (`a`.`log_classification_id` = 2) order by `a`.`log_time` desc) */;

