/*View structure for view v_trip_ticket_list */

/*!50001 DROP TABLE IF EXISTS `v_trip_ticket_list` */;
/*!50001 DROP VIEW IF EXISTS `v_trip_ticket_list` */;

/*!50001 CREATE ALGORITHM=TEMPTABLE DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_trip_ticket_list` AS (select `a`.`id` AS `id`,`a`.`jo_no` AS `jo_no`,`a`.`purpose` AS `purpose`,`a`.`destination` AS `destination`,`a`.`date_requested` AS `date_requested`,`a`.`expected_time_of_return` AS `expected_time_of_return`,`b`.`trip_type` AS `trip_type`,concat(`d`.`last_name`,', ',`d`.`first_name`,' ',left(`d`.`middle_name`,1),'.') AS `requestor_name`,(case when isnull(`a`.`is_cancelled`) then `GetStatusOfTrip`(count(`c`.`id`),`a`.`expected_time_of_return`,max((case `c`.`log_type_id` when 1 then `c`.`log_time` else NULL end))) when (`a`.`is_cancelled` = 1) then 'Cancelled' end) AS `trip_status` from (((`sys_vehicle_monitoring`.`trip_ticket` `a` left join `sys_vehicle_monitoring`.`nature_of_trip` `b` on((`a`.`nature_of_trip_id` = `b`.`id`))) left join `sys_vehicle_monitoring`.`time_log` `c` on((`c`.`trip_ticket_no` = `a`.`id`))) left join `ipc_central`.`personal_information_tab` `d` on((`d`.`employee_id` = `a`.`requestor`))) where isnull(`a`.`delete_user`) group by `a`.`id`) */;

/*View structure for view v_trip_ticket_report */

/*!50001 DROP TABLE IF EXISTS `v_trip_ticket_report` */;
/*!50001 DROP VIEW IF EXISTS `v_trip_ticket_report` */;

/*!50001 CREATE ALGORITHM=TEMPTABLE DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_trip_ticket_report` AS (select `a`.`id` AS `id`,`a`.`jo_no` AS `jo_no`,`a`.`purpose` AS `purpose`,`a`.`date_requested` AS `date_requested`,`a`.`expected_time_of_return` AS `expected_time_of_return`,`b`.`trip_type` AS `trip_type`,(case count(`c`.`id`) when 0 then 'No logs yet' when 1 then 'Open Trip' else 'Closed Trip' end) AS `trip_status` from ((`trip_ticket` `a` left join `nature_of_trip` `b` on((`a`.`nature_of_trip_id` = `b`.`id`))) left join `time_log` `c` on((`a`.`id` = `c`.`trip_ticket_no`))) where isnull(`a`.`delete_user`) group by `a`.`id`) */;

